import React, { useState } from 'react';
import {
  Button
} from '@material-ui/core';

function AddItemForm() {
  const [item, setItem] = useState('');

  return (
    <div>
      <h3>Add new Item</h3>
      <p>{item}</p>
      <Button onClick={setItem('A')}>Add</Button>
    </div>
  );
}

export default AddItemForm;
